import React from 'react';
import './MissionSection.css';

const MissionSection = () => {
  return (
    <section className="mission-section">
      <p className="mission-small">What We Are Doing</p>
      <h2 className="mission-main">Helping young scholars boost their<br />Quantum Computing Skills</h2>
      <p className="mission-description">Through accessible quantum computing education, hands-on hackathons, and beginner-friendly courses, we empower high school and early college students to explore the future of technology. Our mission is to break down barriers to entry, offering early exposure to cutting-edge concepts in a supportive, inclusive environment. By combining foundational knowledge with real-world challenges, we aim to build a diverse community of young innovators equipped to shape the next era of quantum advancement.</p>
    </section>
  );
};

export default MissionSection;
